package com.example.hw_4_3.Country

import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import com.example.hw_4_3.R
import com.example.hw_4_3.databinding.FragmentContinentBinding
import com.example.hw_4_3.databinding.FragmentCountryBinding
import java.text.FieldPosition
import kotlin.properties.Delegates

 class CountryFragment : Fragment() {
    private lateinit var countryList:ArrayList<Country>
    private var position:Int=0
    private lateinit var countryViewAdapter: CountryViewAdapter
    private lateinit var binding: FragmentCountryBinding



    override fun onCreateView(
        inflater: LayoutInflater,
        container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        binding= FragmentCountryBinding.inflate(layoutInflater)
        return binding.root
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        position= arguments?.getInt("pos")!!
        checkPoint(position)
        countryViewAdapter= CountryViewAdapter(countryList)
        binding.rvCountry.adapter=countryViewAdapter
    }

    private fun checkPoint(position: Int) {
        if (position==0){
        loadEvrasia()
        }
        else if(position==1){
            loadSeverAmerica()
        }
        else if(position==2){
            loadUjnayaAmerica()
        }
        else if(position==3){
            loadAfrica()
        }
        else if(position==4){
            loadAvstralia()
        }
    }

    private fun loadEvrasia() {
        countryList= ArrayList()
        countryList.add(Country("Абхазия","data:image/png;base64,"))
        countryList.add(Country("Австрия","https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Flag_of_Austria.svg/375px-Flag_of_Austria.svg.png"))
        countryList.add(Country("Азербайджан","https://www.advantour.com/img/azarbaijan/symbolics/azerbaijan-flag.jpg"))
        countryList.add(Country("Албания","https://upload.wikimedia.org/wikipedia/commons/thumb/3/36/Flag_of_Albania.svg/250px-Flag_of_Albania.svg.png"))
        countryList.add(Country("Армения","https://www.advantour.com/img/armenia/images/flag.jpg"))
    }
    private fun loadSeverAmerica() {
        countryList= ArrayList()
        countryList.add(Country("США","https://gtmarket.ru/files/flags/Flag_of_United_States.png"))
        countryList.add(Country("Канада","https://gtmarket.ru/files/flags/Flag_of_Canada.png"))
        countryList.add(Country("Мексика","https://img.freepik.com/premium-vector/mexico-flag-blowing-in-the-wind-part-of-a-series-mexico-waving-flag_126712-268.jpg"))
        countryList.add(Country("Герландия","https://st.depositphotos.com/1609126/3723/i/600/depositphotos_37238379-stock-photo-greenland-flag.jpg"))
        countryList.add(Country("Ямайка","https://www.kartinki24.ru/uploads/gallery/main/83/kartinki24_ru_country_flags_167.jpg"))
