        countryList.add(Country("Кения","https://safaribooking.ru/wp-content/uploads/2020/03/Respublika-Keniya.jpg"))
        countryList.add(Country("Мароко","https://www.kartinki24.ru/uploads/gallery/main/83/kartinki24_ru_country_flags_82.jpg"))
        countryList.add(Country("Гана","https://pw.artfile.me/wallpaper/09-01-2013/650x366/gana-raznoe-flagi-gerby-gany-flag-695308.jpg"))
