    private fun loadAvstralia() {
        countryList=ArrayList()
        countryList.add(Country("Квинсленд","https://img.freepik.com/premium-photo/3d-illustration-flag-of-queensland-is-a-region-of-australia-waving-on-the-wind-flag-textile-background_141130-1408.jpg?w=2000"))
        countryList.add(Country("новый южный уэльс","https://img.freepik.com/premium-photo/new-south-wales-state-flag-australia-waving-banner-collection-3d-illustration_118047-9022.jpg"))
        countryList.add(Country("западная австралия","data:image/jpeg;base64,"))
        countryList.add(Country("тасмания","data:image/jpeg;base64,"))
        countryList.add(Country("Виктория","data:image/jpeg;base64,"))
    }


}